import React, { Component } from "react";
import { ProductConsumer } from "../context";
import CartColumns from './CartColumns'

export default class Cart extends Component {
  render() {
    return (
      <ProductConsumer>
        <React.Fragment>
          <h1 className="title">Your Cart</h1>
          <CartColumns />
          {value => {
              const {cart} = value;
              
          }}
        </React.Fragment>
      </ProductConsumer>
    );
  }
}
